public ResourceTypes getResourceType() {
  if (this.resourceTypes != null) {
    return this.resourceTypes;
  }

  YarnProtos.ResourceTypeInfoProtoOrBuilder p = viaProto ? proto : builder;
  return convertFromProtoFormat(p.getType());
}
